import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';


function Header() {
    return (

        <div>
            <nav className="navbar navbar-light" 
            style= {{
                backgroundColor: "#ffffff"
            }}>
            <a className="text-aligh-left" href="/" style={{
                color: "#6d98ba",
                paddingLeft: "15px"
            }}>Error and Log Management</a>
            <div><FontAwesomeIcon icon={['fas', 'fa-user-circle']} /></div>


        </nav>

        </div>
    )
}
export default Header;
